import './App.css';
import {SearchBar} from './Components/SearchBar/SearchBar';
import {ProjectTile} from './Components/ProjectTile/ProjectTile';
import {React, useEffect, useState} from 'react';

function App() {
  const [projects, setProjects] = useState([]);

  return (
    <div class="body">

      <div class="nav">
        <h1>Пашов нахуй</h1>
        {/* сюда надо ебало-кнопку засунуть в правый верхний */}
      </div>

      <div class="content">
        <div class="search-bar">
          <SearchBar />
        </div>
        <div class="projects">
            {/*projects.map((item) => {
              return (
                <div class = "item">
                  <ProjectTile project={item}/>
                </div>
              )
            })*/}
          <div class = "item">
            <ProjectTile/>
          </div> 
          <div class = "item">
            <ProjectTile/>
          </div> 
          <div class = "item">
            <ProjectTile/>
          </div> 
          
        </div>
      </div>

    </div>
  );
}

export default App;
